import React from 'react';

import LockNote from '../components/Contents/LockNote/LockNote';
import './Release.css';

class Release extends React.Component {
  render(){
    return(
      <div className='main'>
        <LockNote />
        <div className='main-wrapper'>
         <AboutMe/>
         <SpecialtySkill />
         <Education />
         <WorkExperience />
         <Article />
         <Qualification />
         <Journal />
         <Prize />
        </div>
      </div>
    );
  };
}

export default Release;
